import React from 'react';
import './side-drawer.styles.css';

const SideDrawer = props => (
  <nav className="side-drawer">
    <ul>
      <li>
        <a href="/">About</a>
      </li>
      <li>
        <a href="/">Contact</a>
      </li>
      <li>
        <a href="/">More</a>
      </li>
    </ul>
  </nav>
);

export default SideDrawer;
